import React from "react";
import "./style.css";

function Checkbox() {
  return (
    <div className="row checkbox">
        <div className="col-md-12">
            <div className="col-md-3"></div>
            <div className="col-md-3"></div>
            <div className="col-md-3"></div>
            <div className="col-md-3"></div>
        </div>
    </div>
  );
}

export default Checkbox;
